import { PushAPI, CONSTANTS, Env } from "@pushprotocol/restapi";
import { ethers } from "ethers";
import { useState } from "react";

const usePush = () => {
  const [subscripcionCargando, setSubscripcionCargando] =
    useState<boolean>(false);

  const handleSubscripcion = async () => {
    setSubscripcionCargando(true);

    const provider = new ethers.BrowserProvider(window.ethereum);
    const [address] = await provider.listAccounts();
    const signer = await provider.getSigner(await address.getAddress());

    const user = await PushAPI.initialize(signer, {
      env: CONSTANTS.ENV.STAGING,
    });

    // await user.notification.subscribe(`eip155:11155111:${pushChannelAdress}`);

    const response = await user.channel.send(["*"], {
      notification: {
        title: "Subscribed to NPC Studio!",
        body: "We'll keep you up with your AI workforce, check in soon.",
      },
    });
    setSubscripcionCargando(false);
  };

  const handleNotify = async () => {
    const provider = new ethers.BrowserProvider(window.ethereum);
    const [address] = await provider.listAccounts();
    const signer = await provider.getSigner(await address.getAddress());
    const me = await PushAPI.initialize(signer, {
      env: CONSTANTS.ENV.PROD,
      
    });

    const response = await me.channel.create({
      name: "NPC Studio Notifications",
      description: "Keep up with your AI workforce.",
      icon: `data:image/png;base64,`,
      url: "https://npcstudio.xyz/",
    });

    console.log("after")

    console.log(response);
  };

  return {
    handleSubscripcion,
    subscripcionCargando,
    handleNotify,
  };
};

export default usePush;
